package com.responseUntils;import java.util.Random;public class KeyUntil {    /**     * 生成唯一主键     *     * @author yezi     * @return     */    public static synchronized String genUniqueKey(){        Random random = new Random();        Integer number = random.nextInt(900000) + 100000;        return System.currentTimeMillis() + String.valueOf(number);    }}